import BackToTop from 'vue-backtotop';
import themeConfig from '@/../themeConfigClient.js';
import HNavMenu from "@/pages/trade/navbar/components/HorizontalNavMenu.vue";
import navMenuItems from "@/pages/trade/navbar/navMenuItems.js";
import TheNavbarHorizontal from '@/pages/trade/navbar/BarHorizontal.vue';
import TheNavbarVertical from '@/pages/trade/navbar/BarVertical.vue';
import VNavMenu from '@/pages/trade/navbar/components/VerticalNavMenu.vue';
import AuthenticationService from '@/services/AuthenticationService';
import getData from '@/pages/trade/navbar/components/data.json'; //import LogRegForGet  from '@/pages/user/LogRegForGet.vue'
//import TheCustomizer       from "@/layouts/components/customizer/TheCustomizer.vue"
// import TheFooter           from '@/layouts/components/TheFooter.vue'

var VxTour = function VxTour() {
  return import('@/components/VxTour.vue');
};

export default {
  components: {
    //LogRegForGet,
    BackToTop: BackToTop,
    //TheFooter,
    HNavMenu: HNavMenu,
    VNavMenu: VNavMenu,
    //TheCustomizer,
    TheNavbarHorizontal: TheNavbarHorizontal,
    TheNavbarVertical: TheNavbarVertical,
    VxTour: VxTour
  },
  data: function data() {
    return {
      iSLogin: false,
      navMenuItems: navMenuItems,
      dynamicWatchers: {},
      isNavbarDark: false,
      disableCustomizer: themeConfig.disableCustomizer,
      disableThemeTour: themeConfig.disableThemeTour,
      hideScrollToTop: themeConfig.hideScrollToTop,
      navbarColor: themeConfig.navbarColor || '#fff',
      navbarType: themeConfig.navbarType || 'floating',
      footerType: themeConfig.footerType || 'static',
      routerTransition: themeConfig.routerTransition || 'none',
      steps: [{
        target: '#btnVNavMenuMinToggler',
        content: 'Thu gọn.'
      } // {
      //   target  : '.vx-navbar__starred-pages',
      //   content : 'Tạo dấu trang của riêng bạn. Bạn cũng có thể sắp xếp lại chúng bằng cách kéo và thả.'
      // },
      // {
      //   target  : '.i18n-locale',
      //   content : 'Bạn có thể thay đổi ngôn ngữ từ đây.'
      // },
      // {
      //   target  : '.navbar-fuzzy-search',
      //   content : 'Thử tìm kiếm để truy cập các trang trong nháy mắt.'
      // },
      // {
      //   target  : '.customizer-btn',
      //   content : 'Tùy chỉnh mẫu dựa trên sở thích của bạn',
      //   params  : {
      //     placement: 'left'
      //   }
      // },
      // {
      //   target  : '.vs-button.buy-now',
      //   content : 'Chúng tôi còn rất nhiều sản phẩm khác ^.^!',
      //   params  : {
      //     placement: 'top'
      //   }
      // },
      ]
    };
  },
  watch: {
    "$route": function $route() {
      this.routeTitle = this.$route.meta.pageTitle;
      var token = localStorage.hasOwnProperty('tokenUser');

      if (token) {
        this.iSLogin = true;
        AuthenticationService.getInfoUser().then(function (res) {
          if (res.data.success == 1) {
            var dt = res.data.data;
            getData.uid = dt.id;
            getData.email = dt.email;
            getData.profile_image = dt.profile_image;
            getData.displayName = dt.nick_name;
            getData.uidLive = dt.order[1].u_id;
            getData.uidDemo = dt.order[0].u_id;
            getData.am_usdt = dt.b;
            getData.vip = dt.vip;
            getData.vip_lv = dt.level_vip;
            getData.pen_commiss = dt.pending_commission;
            getData.ref = dt.ref;
            getData.upid = dt.upid;
            getData.c2fa = dt.fa2;
            getData.id_front = dt.id_front;
            getData.id_back = dt.id_back, getData.first_name = dt.first_name;
            getData.last_name = dt.last_name;
            getData.verify = dt.verify;
            getData.num_secu = dt.num_secury;
            getData.country = dt.c;
            getData.so_cmnd = dt.so_cmnd;
            getData.blLive = dt.order[1].balance;
            getData.blDemo = dt.order[0].balance;
            getData.balance = dt.balance;
            localStorage.setItem('INFO', JSON.stringify(dt)); //localStorage.removeItem('isLog')
          } else if (res.data.success == 4) {
            localStorage.removeItem('INFO');
            localStorage.removeItem('tokenUser');
            window.location.href = window.location.origin + '/login'; //let checkLog = localStorage.getItem('isLog')
            //localStorage.setItem('isLog', true);
            //if(!checkLog){
            //    localStorage.setItem('isLog', true)
            //window.location.href = window.location.origin + '/login'
            //}
          }
        });
      } else {
        this.iSLogin = false;
      }
    },
    isThemeDark: function isThemeDark(val) {
      var color = this.navbarColor == "#fff" && val ? "#02142b" : "#fff";
      this.updateNavbarColor(color);
    },
    "$store.state.mainLayoutType": function $storeStateMainLayoutType(val) {
      this.setNavMenuVisibility(val);
      this.disableThemeTour = true;
    }
  },
  computed: {
    bodyOverlay: function bodyOverlay() {
      return this.$store.state.bodyOverlay;
    },
    contentAreaClass: function contentAreaClass() {
      if (this.mainLayoutType === "vertical") {
        if (this.verticalNavMenuWidth == "default") return "content-area-reduced";else if (this.verticalNavMenuWidth == "reduced") return "content-area-lg";else return "content-area-full";
      } // else if(this.mainLayoutType === "boxed") return "content-area-reduced"
      else return "content-area-full";
    },
    footerClasses: function footerClasses() {
      return {
        'footer-hidden': this.footerType == 'hidden',
        'footer-sticky': this.footerType == 'sticky',
        'footer-static': this.footerType == 'static'
      };
    },
    isThemeDark: function isThemeDark() {
      return this.$store.state.theme == 'dark';
    },
    layoutTypeClass: function layoutTypeClass() {
      return "main-".concat(this.mainLayoutType);
    },
    mainLayoutType: function mainLayoutType() {
      return this.$store.state.mainLayoutType;
    },
    navbarClasses: function navbarClasses() {
      return {
        'navbar-hidden': this.navbarType == 'hidden',
        'navbar-sticky': this.navbarType == 'sticky',
        'navbar-static': this.navbarType == 'static',
        'navbar-floating': this.navbarType == 'floating'
      };
    },
    isAppPage: function isAppPage() {
      return this.$route.meta.no_scroll || false;
    },
    verticalNavMenuWidth: function verticalNavMenuWidth() {
      return this.$store.state.verticalNavMenuWidth;
    },
    windowWidth: function windowWidth() {
      return this.$store.state.windowWidth;
    }
  },
  methods: {
    changeRouteTitle: function changeRouteTitle(title) {
      this.routeTitle = title;
    },
    updateNavbar: function updateNavbar(val) {
      if (val == "static") this.updateNavbarColor(this.isThemeDark ? "#02142b" : "#fff");
      this.navbarType = val;
    },
    updateNavbarColor: function updateNavbarColor(val) {
      this.navbarColor = val;
      if (val == "#fff") this.isNavbarDark = false;else this.isNavbarDark = true;
    },
    updateFooter: function updateFooter(val) {
      this.footerType = val;
    },
    setNavMenuVisibility: function setNavMenuVisibility(layoutType) {
      if (layoutType === 'horizontal' && this.windowWidth >= 1200 || layoutType === "vertical" && this.windowWidth < 1200) {
        this.$store.commit('TOGGLE_IS_VERTICAL_NAV_MENU_ACTIVE', false);
        this.$store.dispatch('updateVerticalNavMenuWidth', 'no-nav-menu');
      } else {
        this.$store.commit('TOGGLE_IS_VERTICAL_NAV_MENU_ACTIVE', true);
      }
    },
    updateRouterTransition: function updateRouterTransition(val) {
      this.routerTransition = val;
    },
    toggleHideScrollToTop: function toggleHideScrollToTop(val) {
      this.hideScrollToTop = val;
    },
    khoiTaoPrintUser: function khoiTaoPrintUser() {
      var gData = JSON.parse(localStorage.getItem('INFO'));

      if (gData) {
        getData.uid = gData.id, getData.email = gData.email, getData.profile_image = gData.profile_image, getData.displayName = gData.nick_name, getData.uidLive = gData.order[1].u_id, getData.uidDemo = gData.order[0].u_id, getData.vip = gData.vip, getData.vip_lv = gData.level_vip, getData.pen_commiss = gData.pending_commission, getData.ref = gData.ref, getData.c2fa = gData.fa2, getData.id_front = gData.id_front, getData.id_back = gData.id_back, getData.first_name = gData.first_name, getData.last_name = gData.last_name, getData.verify = gData.verify, getData.num_secu = gData.num_secury, getData.country = gData.c, getData.blLive = gData.order[1].balance;
        getData.blDemo = gData.order[0].balance;
        getData.balance = gData.balance, getData.mkt = gData.mkt;
      }
    }
  },
  created: function created() {
    var _this = this;

    var token = localStorage.hasOwnProperty('tokenUser');

    if (token) {
      this.iSLogin = true;
    }

    this.khoiTaoPrintUser();
    var color = this.navbarColor == "#fff" && this.isThemeDark ? "#02142b" : this.navbarColor;
    this.updateNavbarColor(color);
    this.setNavMenuVisibility(this.$store.state.mainLayoutType); // Dynamic Watchers for tour
    // Reason: Once tour is disabled it is not required to enable it.
    // So, watcher is required for just disabling it.

    this.dynamicWatchers.windowWidth = this.$watch("$store.state.windowWidth", function (val) {
      if (val < 1200) {
        _this.disableThemeTour = true;

        _this.dynamicWatchers.windowWidth();
      }
    });
    this.dynamicWatchers.verticalNavMenuWidth = this.$watch("$store.state.verticalNavMenuWidth", function () {
      _this.disableThemeTour = true;

      _this.dynamicWatchers.verticalNavMenuWidth();
    });
    this.dynamicWatchers.rtl = this.$watch("$vs.rtl", function () {
      _this.disableThemeTour = true;

      _this.dynamicWatchers.rtl();
    });
  },
  beforeDestroy: function beforeDestroy() {
    var _this2 = this;

    Object.keys(this.dynamicWatchers).map(function (i) {
      _this2.dynamicWatchers[i]();

      delete _this2.dynamicWatchers[i];
    });
  }
};
